import "./index.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState } from "react";

import Sidebar from "./components/Sidebar";
import Navbar from "./components/Navbar";
import ClientList from "./components/ClientList";
import NewClientForm from "./components/NewClientForm";
import ClientDetail from "./components/ClientDetail";
import PropertiesList from "./components/PropertyList";
import PropertyDetail from "./components/PropertyDetail";
import ClientPropEngine from "./components/ClientPropEngine";
import OrderList from "./components/OrderList";
import ActivitiesList from "./components/ActivitiesList";
import Informes from "./components/Informes";
import Marketing from "./components/Marketing";
import Questionaries from "./components/Questionaries";
import CreateInstanceSelector from "./components/CreateInstanceSelector";
import Calendar from "./components/Calendar";
import UserPanel from "./components/UserPanel";
import NewEdificioForm from "./components/NewEdificioForm"; 
import NewInmuebleForm from "./components/NewInmuebleForm";

// ðŸ‘‡ IMPORTA el AuthProvider
import { AuthProvider } from "./context/AuthContext";

export default function App() {
  const [sidebarVisible, setSidebarVisible] = useState(true);
  const toggleSidebar = () => setSidebarVisible((prev) => !prev);

  return (
    // ðŸ‘‡ ENVUELVE TODO EN AuthProvider
    <AuthProvider>
      <Router>
        <div className="flex h-screen flex-col">
          <Navbar toggleSidebar={toggleSidebar} />
          <div className="flex flex-1">
            <Sidebar isVisible={sidebarVisible} />
            <div
              className={`flex-1 p-6 overflow-auto transition-all duration-300 ${
                sidebarVisible ? "ml-[10%]" : "ml-0"
              }`}
            >
              <Routes>
                <Route path="/clientes" element={<ClientList />} />
                <Route path="/clientes/nuevo" element={<NewClientForm />} />
                <Route path="/clientes/:id" element={<ClientDetail />} />
                <Route path="/inmuebles" element={<PropertiesList />} />
                <Route path="/inmuebles/:id" element={<PropertyDetail />} />
                <Route path="/solicitudes" element={<PedidoList />} />
                <Route path="/solicitudes/:id" element={<PedidoDetail />} />
                <Route path="/motor-cruce" element={<ClientPropEngine />} />
                <Route path="/solicitudes" element={<OrderList />} />
                <Route path="/actividades" element={<ActivitiesList />} />
                <Route path="/informes" element={<Informes />} />
                <Route path="/marketing" element={<Marketing />} />
                <Route path="/cuestionarios" element={<Questionaries />} />
                <Route path="/crear" element={<CreateInstanceSelector />} />
                <Route path="/agenda" element={<Calendar />} />
                <Route path="/usuario" element={<UserPanel />} />
                <Route path="/edificios/nuevo" element={<NewEdificioForm />} />
                <Route path="/inmuebles/nuevo" element={<NewInmuebleForm />} />
                <Route path="*" element={<ClientList />} />
              </Routes>
            </div>
          </div>
        </div>
      </Router>
    </AuthProvider>
  );
}
